@thejslifestyle we have nobody to throw to. When got rid of AJ brown and let Julio Walk. It’s rebuild mode honestly. Trade DH, bench Tannehill and see how our rookie QB does. I’m just being honest. We have a tough schedule and it’s gonna get worse. 

Our defense can’t stop 3rd downs , long or short. No playmakers on the outside. Our LB’s and Lewan hurt. 

All we have is DH, and if the run is stopped we are losing by a lot
